import React, { useState } from "react";
import logo from "../../assets/Group 1logo white.png";
import './index.scss'
function Navigationbar() {
  let [open,setopen] = useState(true)

 const onClickOpen = ()=>{
    setopen(!open)
  }
  return (
   <header>
     <div className="logo">
      <img clas src={logo} alt="logo" />
    </div>
    <div className="maneubar" style={{transform:`translate(-50%,${open?0:60}%)`}}>
      <div className="menuUi">
        <li>
          Home  
        </li>  
        <li>
          Story  
        </li>  
        <li>
          About 
        </li>  
        <li>
          Contact  
        </li>  
      </div>
      <div className="menuButton" onClick={onClickOpen}>
        {open?"Close":"Menu"}
      </div>
    </div>
   </header>
  );
}

export default Navigationbar;
